import React  from 'react';
import About  from './About';
import Profile  from './Profile';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import Img from "./img/1.jpg";
import ImgP from "./img/cake-1.jpeg";
import IconButton from '@material-ui/core/IconButton';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import MoreVertIcon from '@material-ui/icons/MoreVert';

// import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';

const options = [
    'None',
    'Atria',
    'Callisto',
  ];
  
// eslint-disable-next-line react-hooks/rules-of-hooks


function App1() {
    const [anchorEl, setAnchorEl] =  React.useState(null)
const open = Boolean(anchorEl);

const handleClick = (event) => {
  setAnchorEl(event.currentTarget);
};

const handleClose = () => {
  setAnchorEl(null);
};
   return (
<>
      
        <div className="Img">
            <img className="img-fluid" style={{width: '100%',height:'140px'}}
            src={Img}
            alt="img"/>
       </div>
       <div className="Img">
            <img className="circle" style={{width:'200px', height: '200px',
    borderRadius: '100%',top: '20px',
    position: 'absolute',background:'green'}}
    src='...'
            alt="Joh Doe"/>

            </div>


    <div>
      <IconButton style={{marginLeft:'90%'}}
        aria-label="more"
        aria-controls="long-menu"
        aria-haspopup="true"
        onClick={handleClick} >
        <MoreVertIcon />
      </IconButton>
      <Menu
        id="long-menu"
        anchorEl={anchorEl}
        keepMounted
        open={open}
        onClose={handleClose}>
        {options.map((option) => (
          <MenuItem key={option} selected={option === 'Pyxis'} onClick={handleClose}>
            {option}
          </MenuItem>
        ))}
      </Menu>
    </div>

    
   <Profile/>,
           
         <About/>,
         </>
  );

}
export default App1;
